export class Iconlist extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    getSvg = (id) => {
        return list[id];
    }
    render() {
        const {
            width = 50,
            height = 50,
            iconName,
        } = this.props;
        const icon = list[iconName] || <span>X</span>
        return (
            <i
                className={styles[this.props.className] || styles.icons}
                style={{ width, height }}
                title={this.props.title}
                onClick={this.props.onClick}
            >
                {icon}
            </i>
        );
    }
}
